webpackJsonp([0xe8825a8d9ea3],{1125:function(e,t){e.exports={data:{markdownRemark:{html:'<p>On the occasion of <a href="http://androidcommunity.com/first-live-images-of-fullscreen-android-demo-20080528/">amazing new videos</a> of the latest prototype, it\'s worth remembering that <a href="http://code.google.com/android/">Android</a> (not the just-barely-open iPhone) is the future of mobile development for the masses. Especially when combined with the hardware support of the <a href="http://www.openhandsetalliance.com/">Open Handset Alliance</a> and the general propensity for open source projects to kick ass. </p>\n<p>PS: where the hell is Nokia on <a href="http://www.openhandsetalliance.com/oha_members.html">this list</a>?</p>\n<p>And then there\'s ice cream and underpants: </p>\n<p>[http://www.youtube.com/v/jWtFeIw8MVM]</p>',frontmatter:{created_at:"May 29, 2008",path:"/2008/05/29/the-future-is-all-android-all-open-source-and-underpants-and-ice-cream",title:"The Future is All Android, All Open Source. And Underpants. And Ice Cream.",tags:["android","iphone","mobile","opensource"]}}},pathContext:{}}}});
